module.exports = /*#__PURE__*/JSON.parse('{"header.init.date":"16","header.end.date":"18 de Novembro de 2024","header.location":"Buenos Aires, ARG","header.registration":"Registre-se","hero.title":"Encontro Clerical-Leigo","hero.subtitle.paragraph.1":"A cada dois anos, a comunidade grega da América do Sul se reúne em um evento clerical-leigo único e significativo. Este encontro reúne gregos de vários países da região para refletir sobre sua identidade e fortalecer os laços comunitários. Durante vários dias, os participantes desfrutam de uma agenda rica em atividades culturais, religiosas e festivas, que não só celebram a herança grega, mas também promovem a convivência e o diálogo entre gerações.","hero.subtitle.paragraph.2":"Este ano, o evento acontecerá em Buenos Aires, Argentina, no mês de novembro, e promete ser uma experiência inesquecível. Abrindo caminho para o próximo encontro que será realizado em São Paulo","hero.registration":"Registre-se","hero.metrics.meets":"Palestras","hero.metrics.participants":"Participantes","hero.metrics.place":"Sede","hero.metrics.location":"Localização","schedule.title":"","schedule.subtitle":"Nosso programa de três dias está repleto de atividades, debates e festas.","schedule.subtitle.paragraph":"As credenciais serão realizadas em dois períodos distintos: Para aqueles que chegam na sexta-feira, temos a primeira janela de credenciais das 18:00 às 21:00, na Comunidade Helênica de Buenos Aires - Julián Alvarez. E para aqueles que chegam no sábado, teremos credenciais disponíveis das 9:00 às 10:00 no Instituto Grego Athenagoras I - Lerma 242, onde a abertura será realizada posteriormente.","schedule.date.firstDay":"Sábado 16","schedule.date.firstDay.datetime":"2024-11-16","schedule.date.firstDay.summary":"Primeiro dia oficial do evento","schedule.date.firstDay.timeSlots.0.name":"Credenciamento, Abertura e Coquetel","schedule.date.firstDay.timeSlots.0.description":"Instituto Grego Athenagoras I - Lerma 242","schedule.date.firstDay.timeSlots.0.start":"9:00","schedule.date.firstDay.timeSlots.0.end":"14:00","schedule.date.firstDay.timeSlots.1.name":"Mesas de Debate","schedule.date.firstDay.timeSlots.1.description":"Instituto Grego Athenagoras I - Lerma 242","schedule.date.firstDay.timeSlots.1.start":"15:00","schedule.date.firstDay.timeSlots.1.end":"16:30","schedule.date.firstDay.timeSlots.2.name":"Oficina de Dança","schedule.date.firstDay.timeSlots.2.description":"Salão São Demétrio - Av. Scalabrini Ortiz 1339","schedule.date.firstDay.timeSlots.2.start":"16:30","schedule.date.firstDay.timeSlots.2.end":"18:00","schedule.date.firstDay.timeSlots.3.name":"Reunião Plenária","schedule.date.firstDay.timeSlots.3.description":"","schedule.date.firstDay.timeSlots.3.start":"18:00","schedule.date.firstDay.timeSlots.3.end":"19:30","schedule.date.firstDay.timeSlots.4.name":"Jantar da Juventude","schedule.date.firstDay.timeSlots.4.description":"Salão São Demétrio - Av. Scalabrini Ortiz 1339","schedule.date.firstDay.timeSlots.4.start":"21:30","schedule.date.firstDay.timeSlots.4.end":"4:00","schedule.date.secondDay":"Domingo 17","schedule.date.secondDay.datetime":"2024-11-17","schedule.date.secondDay.summary":"Dia de religião, dança e música","schedule.date.secondDay.timeSlots.0.name":"Divina Liturgia","schedule.date.secondDay.timeSlots.0.description":"Catedral da Dormição da Teótoco - Julián Alvarez 1030","schedule.date.secondDay.timeSlots.0.start":"10:00","schedule.date.secondDay.timeSlots.0.end":"13:00","schedule.date.secondDay.timeSlots.1.name":"Almoço e Panigyri","schedule.date.secondDay.timeSlots.1.description":"Instituto Grego Athenagoras I - Lerma 242","schedule.date.secondDay.timeSlots.1.start":"13:00","schedule.date.secondDay.timeSlots.1.end":"18:00","schedule.date.secondDay.timeSlots.2.name":"Jantar de Gala","schedule.date.secondDay.timeSlots.2.description":"Golden Center - INT. CANTILO Y INT. GUIRALDES","schedule.date.secondDay.timeSlots.2.start":"21:30","schedule.date.secondDay.timeSlots.2.end":"5:00","schedule.date.thirdDay":"Segunda-feira 18","schedule.date.thirdDay.datetime":"2024-04-06","schedule.date.thirdDay.summary":"Dia de encerramento e reflexões finais.","schedule.date.thirdDay.timeSlots.0.name":"Encerramento Oficial","schedule.date.thirdDay.timeSlots.0.description":"Instituto Grego Athenagoras I - Lerma 242","schedule.date.thirdDay.timeSlots.0.start":"12:00","schedule.date.thirdDay.timeSlots.0.end":"14:00","schedule.date.thirdDay.timeSlots.1.name":"Coquetel de Despedida","schedule.date.thirdDay.timeSlots.1.description":"Instituto Grego Athenagoras I - Lerma 242","schedule.date.thirdDay.timeSlots.1.start":"14:00","schedule.date.thirdDay.timeSlots.1.end":"15:00","speakers.title":"Mesas de Debate","speakers.description":"Esta é uma das estações fundamentais do programa que se impõe como uma necessidade, para que os participantes e instituições possam se enriquecer através da livre participação - de acordo com seus próprios interesses - em mesas de debate que versarão sobre as duas áreas de reflexão e ação que nos convocam - Igreja e Comunidade. As temáticas dessas mesas de debate são baseadas nas discussões das plenárias realizadas no reencontro clérico-leigo de Montevidéu. Dessa forma, garante-se a continuidade, o monitoramento e o acompanhamento da evolução da reflexão e, sobretudo, da execução das propostas apresentadas.","tables.helenic.name":"Liderança Helênica","tables.helenic.nickname":"Liderança","tables.helenic.datetime":"2022-04-04","tables.helenic.speakers.items.0.title":"Questões Atuais","tables.helenic.speakers.items.0.text":"Financiamento e sustentabilidade, Participação e relevância na comunidade, Integração de novas gerações.","tables.helenic.speakers.items.1.title":"Continuidade do Helenismo e da Ortodoxia","tables.helenic.speakers.items.1.text":"Importância de manter vivas as tradições e a cultura helênica. Importância da cooperação com a Igreja em estratégias comuns para manter a fé e a cultura. Papel das instituições como guardiãs da identidade helênica e da espiritualidade. Estratégias para fortalecer a presença grega na América Latina.","tables.helenic.speakers.items.2.title":"Manter viva a língua grega e a Ortodoxia","tables.helenic.speakers.items.2.text":"Programas de ensino da língua. Desafios e oportunidades. Impacto na preservação da fé e da cultura. Por que manter a fé viva é garantia de continuidade do Helenismo na América do Sul.","tables.helenic.speakers.items.3.title":"Ser embaixadores da Grécia e da Ortodoxia","tables.helenic.speakers.items.3.text":"Responsabilidades das instituições helênicas na promoção de valores culturais e espirituais. Promoção da cultura grega. Manutenção da fé. Colaboração com entidades gregas.","tables.helenic.speakers.items.4.title":"Conclusões e Recomendações","tables.helenic.speakers.items.4.text":"Síntese dos pontos-chave. Propostas concretas para o fortalecimento das instituições e a continuidade do Helenismo e da Ortodoxia sob a ótica da liderança helênica sul-americana.","tables.culture.name":"Promoção da Cultura","tables.culture.nickname":"Cultura","tables.culture.datetime":"2022-04-05","tables.culture.speakers.items.0.title":"Desafios no Ensino da Língua Grega","tables.culture.speakers.items.0.text":"Disponibilidade de programas e recursos. Formação de professores. Integração no sistema educativo oficial. Reflexões e contribuições sobre o sistema atual de envio de professores da Grécia.","tables.culture.speakers.items.1.title":"Escolas Oficiais e de Línguas","tables.culture.speakers.items.1.text":"Diferenças e benefícios. Papel na promoção da cultura grega. Experiências de sucesso e lições aprendidas.","tables.culture.speakers.items.2.title":"Currículo Educacional","tables.culture.speakers.items.2.text":"Conteúdo e abordagens. Adaptação às necessidades das novas gerações. Incorporação de tecnologia e recursos digitais.","tables.culture.speakers.items.3.title":"Conclusões e Recomendações","tables.culture.speakers.items.3.text":"Identificação de áreas para melhoria. Propostas para fortalecer o ensino e a promoção da cultura grega na América Latina. Propostas para melhorar o atual sistema de envio de professores da Grécia.","tables.youth.name":"Juventude","tables.youth.nickname":"Juventude","tables.youth.datetime":"2022-04-06","tables.youth.speakers.items.0.title":"Futuros Líderes","tables.youth.speakers.items.0.text":"Compromisso com a religião, cultura, língua e costumes. Desafios e oportunidades. Formação e educação para a liderança.","tables.youth.speakers.items.1.title":"Atividades e Trocas com a Grécia","tables.youth.speakers.items.1.text":"Experiências de troca cultural. Benefícios para o desenvolvimento pessoal e comunitário. Promoção da conexão com a terra natal.","tables.youth.speakers.items.2.title":"Promoção da Participação Juvenil","tables.youth.speakers.items.2.text":"Estratégias para envolver mais jovens. Criação de espaços e atividades atraentes. Reconhecimento do papel da juventude nas instituições helênicas.","tables.youth.speakers.items.3.title":"Como a Igreja Acolhe os Jovens?","tables.youth.speakers.items.3.text":"Estratégias para envolver mais jovens nas atividades da igreja. Catequese para jovens.","tables.youth.speakers.items.4.title":"Conclusões e Recomendações","tables.youth.speakers.items.4.text":"Reflexões sobre o compromisso atual dos jovens. Propostas para fortalecer a participação e a liderança dos jovens nas comunidades helênicas e na Igreja.","tables.orthodoxy.name":"Ortodoxia","tables.orthodoxy.nickname":"Igreja","tables.orthodoxy.datetime":"2022-04-06","tables.orthodoxy.speakers.items.0.title":"Hipóstase","tables.orthodoxy.speakers.items.0.text":"Por que é necessária a presença da Igreja Ortodoxa na América do Sul. O papel da Igreja Ortodoxa nas sociedades modernas e como ela pode definir tendências. Uma Ortodoxia Sul-Americana?","tables.orthodoxy.speakers.items.1.title":"Missão","tables.orthodoxy.speakers.items.1.text":"Missão e Evangelização. Catequese. Formação de novos candidatos locais ao sacerdócio. Vida litúrgica. Promoção de estratégias espirituais para abordar a crise espiritual do homem moderno sul-americano. Projeção de dinâmicas espirituais para manter valores de vida coerentes com a fé. Sensibilização sobre a necessidade de que a Igreja Ortodoxa contribua para aliviar a pobreza orgânica em nossos países.","tables.orthodoxy.speakers.items.2.title":"Dificuldades","tables.orthodoxy.speakers.items.2.text":"Financiamento e administração. Crise vocacional. Agnosticismo e indiferença espiritual. Falta de coordenação e cooperação entre as diferentes jurisdições ortodoxas na América do Sul. Falta de testemunho comum.","tables.orthodoxy.speakers.items.3.title":"Desafios","tables.orthodoxy.speakers.items.3.text":"Inclusividade e fidelidade ao Evangelho e à Tradição: a mistura correta e lícita. A juventude como objetivo pastoral e missionário da Igreja: estratégias e dificuldades na missão. Transcender o “gueto religioso” e abrir a Igreja a todos os povos. Acessibilidade litúrgica: projeto de traduções litúrgicas. Reconhecimento legal da Arquidiocese nos países de sua jurisdição. Reconhecimento dos dias festivos nos diversos países da jurisdição sul-americana.","tables.orthodoxy.speakers.items.4.title":"Conclusões e Recomendações","tables.orthodoxy.speakers.items.4.text":"Síntese dos pontos-chave. Propostas concretas para fortalecer a instituição arquidiocesana em todos os níveis, a fim de garantir a continuidade do Helenismo e da Ortodoxia.","sponsorship.title":"Patrocinadores","pricing.title":"Taxas","pricing.subtitle":"Selecione seu país para ver onde realizar seu pagamento","pricing.adult.title":"Taxa para Adultos (+31 anos)","pricing.youth.title":"Taxa para Jovens (-30 anos)","pricing.adult.whats.inlcuded":"O que está incluído?","pricing.adult.price.pre.text":"Preço final","pricing.item.cocktail":"Coquetel de abertura","pricing.item.debate.table":"Mesas de debate","pricing.item.greek.dance":"Oficina de dança","pricing.item.paniguiri":"Almoço e Paniguiri","pricing.item.youth.dinner":"Jantar de jovens","pricing.item.gala.dinner":"Jantar de gala","pricing.item.last.cocktail":"Coquetel de encerramento","modal.pre.registration.title":"Registre-se","modal.pre.registration.button":"Ir para o formulário","modal.pre.registration.body":"Selecione seu país para ser redirecionado para o formulário de inscrição correspondente"}');

